import React, { Component } from 'react';
import NavbarItem from './NavbarItem';

class Navbar extends Component {
  render() {
    const NavbarTitles = ['Pokemons', 'Types'];

    return (
      <div>
        NavbarTitles.map((item) => (<NavbarItem title={item} />
        ))
      </div>
    );
  }
}

export default Navbar;
